function [res] = romberg_integral (f, start_, end_, n)
% n is the size of Romberg table

    % initialization
    h = end_ - start_;
    R = zeros(2, n);
    R(1, 1) = h/2 * (f(start_) + f(end_));

    for i = 2:n

        sum_ = sum(arrayfun(f, start_ + ((1:2^(i-2))-0.5)*h));
        R(2, 1) = 1/2 * (R(1, 1) + h*sum_);

        for j = 2:i
            R(2, j) = R(2, j-1) + (R(2, j-1)-R(1, j-1)) / (4^(j-1)-1);
        end

        h = h/2;
        R(1, :) = R(2, :);
    end

    res = R(2, n);
end
